import React from "react";
import "@coreui/coreui/dist/css/coreui.min.css";
import {
    CButton
  } from "@coreui/react";
const Login = () => {
  return (
  <>
  
  Microsoft Teams
  Meet chat and collaborate in one place
  <CButton color="primary" type="submit">Sign in</CButton>
  <CButton color="" type="submit">Sign in</CButton>
  </>
  );
};

export default Login;
